import styled from "styled-components"
import {PageWrap } from "../components/common/styled";
import Header from "../components/common/header";


const IndexPage = () => {
    return (
        <PageWrap>
            <Header page="index" />
            <IndexText>컴공선배 리액트 템플릿 입니다.</IndexText>
        </PageWrap>
    )
}


export default IndexPage
